import React from 'react';
import Homepage from './pages/homepage/homepage.component'
import { Route, Switch } from 'react-router-dom'

const Hatpage = () => (
  <div>
    <h1>Hats Page</h1>
  </div>
)

function App() {
  return (

    <div>
      <Switch>
        <Route exact path='/' component={Homepage} />
        <Route exact path='/hats' component={Hatpage} />
      </Switch>
    </div>
  );
}

export default App;
